import React, { useState } from 'react';
import api from '../services/api';

const Registration: React.FC = () => {
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    email: '',
    phone: '',
    country: '',
    category: 'MS'
  });
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(false);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const submit = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);
    setMessage('');

    try {
      // Validation
      if (!formData.name.trim()) {
        setMessage('‚ùå Name is required');
        setLoading(false);
        return;
      }

      if (!formData.age) {
        setMessage('‚ùå Age is required');
        setLoading(false);
        return;
      }

      const payload = {
        name: formData.name.trim(),
        age: parseInt(formData.age),
        email: formData.email.trim() || null,
        phone: formData.phone.trim() || null,
        country: formData.country.trim() || null,
        category: formData.category
      };

      const res = await api.post('/players/', payload);
      console.log('Created player:', res.data);
      setMessage('‚úÖ Player registered successfully!');

      // Reset form
      setFormData({
        name: '',
        age: '',
        email: '',
        phone: '',
        country: '',
        category: 'MS'
      });

    } catch (err: any) {
      console.error('Registration error:', err);
      const detail = err?.response?.data || err?.message || 'Network Error';
      setMessage('‚ùå ' + (typeof detail === 'string' ? detail : JSON.stringify(detail)));
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{
      padding: '30px',
      maxWidth: '800px',
      margin: '0 auto',
      fontFamily: 'Arial, sans-serif',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      minHeight: '100vh',
      color: 'white'
    }}>
      <div style={{
        background: 'rgba(255,255,255,0.1)',
        borderRadius: '20px',
        padding: '40px',
        backdropFilter: 'blur(10px)',
        border: '1px solid rgba(255,255,255,0.2)',
        boxShadow: '0 8px 32px rgba(0,0,0,0.3)'
      }}>
        <h2 style={{
          textAlign: 'center',
          marginBottom: '30px',
          fontSize: '2.5em',
          textShadow: '2px 2px 4px rgba(0,0,0,0.3)',
          color: '#ffd700'
        }}>
          üèì Player Registration
        </h2>

        <form onSubmit={submit} style={{ display: 'grid', gap: '20px' }}>
          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
            <div>
              <label style={{
                display: 'block',
                marginBottom: '8px',
                fontWeight: 'bold',
                color: '#ffd700'
              }}>
                Full Name *
              </label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleInputChange}
                required
                style={{
                  width: '100%',
                  padding: '12px',
                  borderRadius: '10px',
                  border: 'none',
                  background: 'rgba(255,255,255,0.9)',
                  color: '#333',
                  fontSize: '16px',
                  boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
                }}
                placeholder="Enter full name"
              />
            </div>

            <div>
              <label style={{
                display: 'block',
                marginBottom: '8px',
                fontWeight: 'bold',
                color: '#ffd700'
              }}>
                Age *
              </label>
              <input
                type="number"
                name="age"
                value={formData.age}
                onChange={handleInputChange}
                min="8"
                max="100"
                required
                style={{
                  width: '100%',
                  padding: '12px',
                  borderRadius: '10px',
                  border: 'none',
                  background: 'rgba(255,255,255,0.9)',
                  color: '#333',
                  fontSize: '16px',
                  boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
                }}
                placeholder="Enter age"
              />
            </div>
          </div>

          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
            <div>
              <label style={{
                display: 'block',
                marginBottom: '8px',
                fontWeight: 'bold',
                color: '#ffd700'
              }}>
                Email
              </label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleInputChange}
                style={{
                  width: '100%',
                  padding: '12px',
                  borderRadius: '10px',
                  border: 'none',
                  background: 'rgba(255,255,255,0.9)',
                  color: '#333',
                  fontSize: '16px',
                  boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
                }}
                placeholder="Enter email (optional)"
              />
            </div>

            <div>
              <label style={{
                display: 'block',
                marginBottom: '8px',
                fontWeight: 'bold',
                color: '#ffd700'
              }}>
                Phone
              </label>
              <input
                type="tel"
                name="phone"
                value={formData.phone}
                onChange={handleInputChange}
                style={{
                  width: '100%',
                  padding: '12px',
                  borderRadius: '10px',
                  border: 'none',
                  background: 'rgba(255,255,255,0.9)',
                  color: '#333',
                  fontSize: '16px',
                  boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
                }}
                placeholder="Enter phone (optional)"
              />
            </div>
          </div>

          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
            <div>
              <label style={{
                display: 'block',
                marginBottom: '8px',
                fontWeight: 'bold',
                color: '#ffd700'
              }}>
                Country
              </label>
              <input
                type="text"
                name="country"
                value={formData.country}
                onChange={handleInputChange}
                style={{
                  width: '100%',
                  padding: '12px',
                  borderRadius: '10px',
                  border: 'none',
                  background: 'rgba(255,255,255,0.9)',
                  color: '#333',
                  fontSize: '16px',
                  boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
                }}
                placeholder="Enter country (optional)"
              />
            </div>

            <div>
              <label style={{
                display: 'block',
                marginBottom: '8px',
                fontWeight: 'bold',
                color: '#ffd700'
              }}>
                Category *
              </label>
              <select
                name="category"
                value={formData.category}
                onChange={handleInputChange}
                style={{
                  width: '100%',
                  padding: '12px',
                  borderRadius: '10px',
                  border: 'none',
                  background: 'rgba(255,255,255,0.9)',
                  color: '#333',
                  fontSize: '16px',
                  boxShadow: '0 4px 8px rgba(0,0,0,0.1)',
                  cursor: 'pointer'
                }}
              >
                <option value="MS">üèì Men Singles</option>
                <option value="WS">üèì Women Singles</option>
                <option value="MD">üèì Men Doubles</option>
                <option value="WD">üèì Women Doubles</option>
                <option value="XD">üèì Mixed Doubles</option>
              </select>
            </div>
          </div>

          <div style={{ textAlign: 'center', marginTop: '30px' }}>
            <button
              type="submit"
              disabled={loading}
              style={{
                background: loading ? '#666' : 'linear-gradient(45deg, #4CAF50, #45a049)',
                color: 'white',
                border: 'none',
                padding: '15px 40px',
                borderRadius: '25px',
                cursor: loading ? 'not-allowed' : 'pointer',
                fontSize: '18px',
                fontWeight: 'bold',
                boxShadow: '0 6px 20px rgba(0,0,0,0.3)',
                transition: 'transform 0.2s, box-shadow 0.2s',
                textTransform: 'uppercase',
                letterSpacing: '1px'
              }}
              onMouseEnter={(e) => {
                if (!loading) {
                  e.currentTarget.style.transform = 'translateY(-2px)';
                  e.currentTarget.style.boxShadow = '0 8px 25px rgba(0,0,0,0.4)';
                }
              }}
              onMouseLeave={(e) => {
                if (!loading) {
                  e.currentTarget.style.transform = 'translateY(0)';
                  e.currentTarget.style.boxShadow = '0 6px 20px rgba(0,0,0,0.3)';
                }
              }}
            >
